-- ----------------------------
-- Table structure for aoi_pcbs
-- ----------------------------
DROP TABLE IF EXISTS `aoi_pcbs`;
CREATE TABLE `aoi_pcbs`  (
  `id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `software_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关联的程式id',
  `pcb_number` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '编号',
  `pcb_name` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '名字',
  `carrier_width` int(11) NULL DEFAULT NULL COMMENT '载板宽',
  `carrier_height` int(11) NULL DEFAULT NULL COMMENT '载板高',
  `pcb_width` int(11) NOT NULL COMMENT 'pcb宽',
  `pcb_height` int(11) NOT NULL COMMENT 'pcb高',
  `pcb_childen_number` int(11) NOT NULL COMMENT '子集板数量',
  `pcb_path` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'pcb检测信息的相对路径以\\开头',
  `ng_count` int(11) NULL DEFAULT NULL COMMENT 'ng缺陷的数量',
  `is_misjudge` int(11) NOT NULL COMMENT '是否误判, 0否 1是, 只要results下有一个误判，那该值就改为1',
  `is_error` int(11) NOT NULL COMMENT '是否报错, 0否 1是',
  `create_time` datetime(0) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `software_id`(`software_id`) USING BTREE,
  CONSTRAINT `aoi_pcbs_ibfk_1` FOREIGN KEY (`software_id`) REFERENCES `aoi_softwares` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

