-- ----------------------------
-- Table structure for aoi_results
-- ----------------------------
DROP TABLE IF EXISTS `aoi_results`;
CREATE TABLE `aoi_results`  (
  `id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `is_back` int(11) NOT NULL COMMENT '是否是背面{0：正面 1：背面}',
  `score` float(11, 11) NULL DEFAULT NULL COMMENT 'AI得分',
  `pcb_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '对应的aoi_pcbs表的id',
  `area` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '缺陷在整板的区域',
  `region` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '缺陷在part_image_path图片的区域',
  `ng_type_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '对应aoi_ng_types表的缺陷id',
  `is_misjudge` int(11) NOT NULL COMMENT '是否误判, 0否 1是',
  `result_ng_type_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '人工复判的结果对应aoi_ng_types表的缺陷id',
  `part_image_path` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '缺陷图存储的相对于pcb目录的路径',
  `create_time` datetime(0) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `IX_pcb_id`(`pcb_id`) USING BTREE,
  INDEX `ng_type_id`(`ng_type_id`) USING BTREE,
  CONSTRAINT `FK_results_pcbs_pcb_id` FOREIGN KEY (`pcb_id`) REFERENCES `aoi_pcbs` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `aoi_results_ibfk_1` FOREIGN KEY (`ng_type_id`) REFERENCES `aoi_ng_types` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

